import React from "react";
import ReactDOM from "react-dom";
let elem = React.createElement("div", null, "АЛЕЙКУМ АССАЛАМ")
//<h1>САЛАAAAAМ АЛЕЙКУМ</h1>;

ReactDOM.render(elem, document.querySelector("#root"));
